post_text:
There are so many reasons why M-W is such an amazing community. At the top of the list are the local businesses, organizations, groups and families who helped make the holiday season a brighter, less stressful one for some local families. The district is so grateful for all who had a part in the sharing of goodwill this holiday season.
Special thanks to:
David Mistretta and the retailers of the Woodbury Common Outlets who fulfilled clothing wish lists for more than 70 students;
Target for $100 gift cards for 120 students who did holiday shopping with community service members: Heroes: ‚Äì Police Officers, Fire Fighters and Emergency Response Members and Helpers ‚Äì Target employees;
The MW Rotary Club for hosting Breakfast with Santa at Chicago Uno Pizza Grill. In addition to enjoying breakfast with all of their family members, students received gifts purchased by Uno employees.
Thank you from the bottom of our hearts!

